window.bookSummaryJSON = "<p>We're the D'Artigo sisters: savvy half-human, half-fae operatives for the Otherworld Intelligence Agency. My sister Delilah is a two-faced werecat and a Death Maiden. Menolly is a vampire married to a gorgeous werepuma and a vampire prince. And me? I'm Camille, a Moon Witch married to three gorgeous husbands, and I'm about to ascend to the throne of Dusk and Twilight. But the path to the throne lies through a labyrinth of dangers, which I must face alone. </p> <p>Before I can fulfill my destiny to become the queen of Dusk and Twilight, I must seek out the Keraastar Diamond. But to find the magical gem and take control over the Keraastar Knights, I must venture back to Otherworld, deep into the treacherous Tygerian Mountains. Once there, I face a magical trial by fire. If I fail, Pentangle, the Mistress of Magic, will destroy me. If I succeed, my life will forever change. And I'm not certain which prospect frightens me more. </p>"; 
